var Ac4yFlowConstant=require("../constant/Ac4yFlowConstant.js");
var Ac4yLCDState=require("@ac4y/ac4y-lifecycle/domain/Ac4yLCDState.js");

var Ac4yLCFState=require("@ac4y/ac4y-lifecycle/domain/Ac4yLCFState.js"); 

class Ac4yFLCDState extends Ac4yLCDState {
    
    createSelf(object) {return new Ac4yFLCDState(object);}
 
    becomesTimeout(){this.becomes(new Ac4yLCFState({name: new Ac4yFlowConstant().STATE.timeout}));};
    
} // Ac4yFLCDState

module.exports=Ac4yFLCDState
